Movie Info: Bullett Raja is a 2013 Hindi action film written and directed by Tigmanshu Dhulia and produced by Rahul Mittra, Nitin Tej Ahuja and Tigmanshu Dhulia, under the banner of BrandSmith Motion Pictures and Moving Pictures. The film is presented by Fox Star Studios. The film features Saif Ali Khan, Sonakshi Sinha and Jimmy Shergill in leading roles, whilst Chunky Pandey, Ravi Kishan, Gulshan Grover and Vidyut Jamwal feature in pivotal roles. The film is set against the backdrop of Uttar Pradesh-based mafia while dealing with the political and industrial powers of the state. The film is slated for release on 29 November 2013.


